export const { width: SCREEN_WIDTH, height: SCREEN_HEIGHT, screenShape } = getDeviceInfo()
export const isRound = screenShape == SCREEN_SHAPE_ROUND

const button = {
    W: 96,
    H: 96
}
export function createBack({ UI = hmUI, y }) {
    UI.createWidget(widget.BUTTON, {
        x: (SCREEN_WIDTH - button.W) / 2,
        y: y,
        w: button.W,
        h: button.H,
        normal_src: `image/back_gray.png`,
        press_src: `image/back.png`,
        click_func: back
    })
}

