export function getNewWord(lang, words) {
    let arr = []
    let list = WORDS_LIST[lang]
    let found = Object.keys(words)
    if (found.length) {
        const set = new Set(found)
        arr = list.filter(item => !set.has(item))
    } else arr = list

    if (arr.length == 0) return false

    let index = Math.round(Math.random() * (arr.length - 1))
    return Array.from(arr[index])
}